    slots.sort(key=lambda s: (s.start, -s.priority))
    for i in range(len(slots) - 2):
        if slots[i].end >= slots[i + 1].start + duration and slots[i + 1].end >= slots[i + 2].start + duration:
            return [slots[i + 1].start, slots[i + -1].start + duration]
    return []
